import React from 'react'
import { useHistory } from 'react-router-dom/cjs/react-router-dom.min';   /* or useNavigate */
// import { useNavigate } from 'react-router-dom';

import './AskQuestion.css'

const AskQuestion = () => {

    const user = 1;
    const history = useHistory();
    // const navigate = useNavigate()

    const redirect = () => {
        alert("login or signup to ask a question");
        history.push('/Auth');
        // navigate('/Auth');
    }

  return (
    <>
        {
            user == null ?
            redirect():
            <div className='ask-question'>
                <div className="ask-ques-container">
                    <h1>Ask a public Question</h1>
                    <form action="">
                        <div className="ask-form-container">
                            <label htmlFor="ask-ques-title">
                                <h1>Title</h1>
                                <p>Be specific and imagine your are asking a question to another person</p>
                                <input type="text" id='ask-ques-title' placeholder='e.g. Is there an R function for finding the index of an element in a vector ?'/>
                            </label>
                            <label htmlFor="ask-ques-body">
                                <h1>Body</h1>
                                <p>Include all the information someone would need to answer your question</p>
                                <input type="text" id='ask-ques-title' />
                            </label>
                            <label htmlFor="ask-ques-title">
                                <h1>Title</h1>
                                <p>Be specific and imagine your are asking a question to another person</p>
                                <input type="text" id='ask-ques-title' placeholder='e.g. Is there an R function for finding the index of an element in a vector ?'/>
                            </label>

                        </div>
                    </form>
                </div>
            </div>
        }
    </>
  )
}

export default AskQuestion


// note:
/*
In form 'htmlFor' and 'id' should be same


*/
